import React from 'react';
import { Helmet } from 'react-helmet';

export default function Refonte() {
  return (
    <main className="bg-[#181B20] min-h-screen text-white font-sans">
      <Helmet>
        <title>Refonte de site web à Nantes | NovaWeb</title>
        <meta name="description" content="Refonte de site web à Nantes et Pays de la Loire. Modernisation, optimisation SEO, nouveau design, meilleure performance." />
      </Helmet>
      <section className="max-w-4xl mx-auto py-16 px-6">
        <h1 className="text-4xl font-bold mb-8 text-center">Refonte de site web à Nantes</h1>
        <p className="text-lg text-gray-300 mb-6 text-center">Modernisez votre présence en ligne avec une refonte complète : nouveau design, meilleures performances, optimisation SEO et expérience utilisateur.</p>
        <ul className="list-disc list-inside text-gray-300 mb-8">
          <li>Audit et recommandations</li>
          <li>Design moderne et responsive</li>
          <li>Optimisation SEO</li>
          <li>Migration et accompagnement</li>
        </ul>
        <p className="text-center"><a href="/contact" className="cta-btn">Demander un devis</a></p>
      </section>
    </main>
  );
}
